    false,nt"url": null,nt"notes": "Natural resource management plan for the
    Rocky Mountain Arsenal (RMA) was prepared by Colorado State University for the U.S.
    Government to guide management to restore, improve, protect and preserve, through
    wise, integrated resource management, the installation's natural resources, providing
    optimum multiple use benefits, present and in the future, for the U.S. Government,
    Rocky Mountain Arsenal, and the general public as is consistent with the assigned
    military mission. The plan is organized into five major sections. This first section,
    I, General, discusses the plan's goals and the historical background of RMA as it
    relates to the natural resources. This section also contains the baseline information
    pertinent to various sections of the plan. The next three sections.Ii, Range Conservation,
    Restoration and Landscaping Programs; III, Wildlife Program; and IV, Outdoor Recreation
    Program, discuss each respective program's objectives, management situation and
    recommendations. Finally, section V, Environmental Impact Assessment, points out
    the likely environmental impact of the proposed actions. The plan is separated into
    two volumes. Volume I contains the basic plan. Volume II contains supplementary
    data and large scale maps of baseline inventory information.",nt"owner_org":
